import React from 'react';
import sample from './../sample.json'

function Twitter() {
  let tweetText = [];
  let tweetList = [];
  // sample.map((tweet) =>
  //   <li>{tweet.text}</li>,
  //   tweetText.push(tweet.text)
  // );

  sample.forEach(tweet => {
    tweetList.push(<li>{tweet.text.slice(0, tweet.text.indexOf('http')).trim()}</li>);
    // Finds index of https link and cuts it off before creating master tweetText
    tweetText.push(tweet.text.slice(0, tweet.text.indexOf('http')).trim());
  });

  console.log(tweetList);

  // tweetText.forEach(tweet => {
  //   tweet.slice(0, tweet.indexOf('http'))
  // });
  // makes an array of every word tweeted
  tweetText = tweetText.join(' ').split(' ');
  console.log(tweetText);



  return (
    <div>
      <h2>Twitter comp here makes API call</h2>
      <ul>
        {tweetList}
      </ul>
    </div>
  );

}

export default Twitter;
